import Link from "next/link";

const Navigation = () => {
  return (
    <ul>
      <li>
        <a href='/'>Index</a>
      </li>
      <li>
        <a href='/about'>About</a>
      </li>
      <li>
        <a href='/services'>Services</a>
      </li>
    </ul>
  );
};

export default Navigation;
